let Save=document.getElementById("SaveProduct");
Save.addEventListener("click",function() {
    localStorage.setItem("product",JSON.stringify(allProduct));
    alert("Lưu thành công");
});

let Push=document.getElementById("PushProduct");
Push.addEventListener("click",function() {
    let allProduct=JSON.parse(localStorage.getItem("product"));
    let newProduct={
        id: "5",
        name: "Redmi",
        price: "190000",
        img: "data:image/jpeg;base64,"
    }
    allProduct.push(newProduct);
    localStorage.setItem("product",JSON.stringify(allProduct));
    alert("Save complte");
});

function createcard() {
    let allProduct=JSON.parse(localStorage.getItem("product"));
    let listCard=document.getElementById("listCard");
    for(let i=0;i<allProduct.length;i++)
    {
        let product=allProduct[i];
        let card=`<div class="card">
            <img src=${product.img} alt="Denim Jeans" style="width:100%">
            <h1>${product.name}</h1>
            <p class="price">${product.price}</p>
            <p>Some text about the jeans. Super slim and comfy lorem ipsum lorem jeansum. Lorem jeamsun denim lorem jeansum.
            </p>
            <p><button>Add to Cart</button></p>
        </div>`;
        listCard.innerHTML+=card;
    }
}
createcard();